export const OPTIONS =
  data
    .map((row) => {
      return {
        label: row.BrandName,
        value: row.BrandName,
      }
    })
    .filter((option, index, self) => {
      return self.findIndex((o) => o.value === option.value) === index
    }) ??
  [] ??
  []

export const MODEL_OPTIONS =
  data
    .map((row) => {
      return {
        label: row.Model,
        value: row.Model,
      }
    })
    .filter((option, index, self) => {
      return self.findIndex((o) => o.value === option.value) === index
    }) ??
  [] ??
  []
